import React, { useEffect, useRef } from "react";

// Define variables for the audio context and processing node
let audioInputContext = null;
let workletNode = null;
let initialized = false;

let b64PCM =
  "";

let currentFrameB64 =
  "";

// Utility function to convert base64 to ArrayBuffer
function base64ToArrayBuffer(base64) {
  const binaryString = atob(base64);
  const len = binaryString.length;
  const bytes = new Uint8Array(len);
  for (let i = 0; i < len; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }
  return bytes.buffer;
}

// Utility function to convert PCM 16LE data to Float32
function convertPCM16LEToFloat32(arrayBuffer) {
  const int16Array = new Int16Array(arrayBuffer);
  const float32Array = new Float32Array(int16Array.length);
  for (let i = 0; i < int16Array.length; i++) {
    float32Array[i] = int16Array[i] / 32768; // Normalize to [-1, 1]
  }
  return float32Array;
}

// WebSocket connection component
function WebSocketConnection({ url }) {
  // Keep a reference to our WebSocket instance
  const webSocketRef = useRef(null);

  // This effect runs once on mount (and cleans up on unmount)
  useEffect(() => {
    console.log("Connecting to:", url);

    // Create the WebSocket connection
    webSocketRef.current = new WebSocket(url);

    // Handle various WebSocket events
    webSocketRef.current.onopen = (event) => {
      console.log("WebSocket open:", event);
      sendInitialSetupMessage();
    };

    webSocketRef.current.onmessage = (event) => {
      receiveMessage(event);
    };

    webSocketRef.current.onclose = (event) => {
      console.log("WebSocket closed:", event);
      alert("Connection closed");
    };

    webSocketRef.current.onerror = (event) => {
      console.log("WebSocket error:", event);
    };

    // Cleanup: close the WebSocket when this component unmounts
    return () => {
      if (webSocketRef.current) {
        webSocketRef.current.close();
      }
    };
  }, [url]);

  // Reusable function to send the initial setup message
  const sendInitialSetupMessage = () => {
    console.log("Sending setup message");

    const setup_client_message = {
      setup: {
        generation_config: { response_modalities: ["AUDIO"] },
      },
    };

    // Only send if the WebSocket is open
    if (
      webSocketRef.current &&
      webSocketRef.current.readyState === WebSocket.OPEN
    ) {
      webSocketRef.current.send(JSON.stringify(setup_client_message));
    }
  };

  // Handle incoming messages
  const receiveMessage = async (event) => {
    const messageData = JSON.parse(event.data);
    const response = messageData; // Assuming response is the parsed JSON
    console.log("Received:", response);

    // if (response.text) {
    //   displayMessage("GEMINI: " + response.text);
    // }
    // if (response.audioData) {
    //   await injestAudioChuckToPlay(response.audioData);
    // }
  };

  const displayMessage = (message) => {
    console.log(message);
    addParagraphToDiv("chatLog", message);
  };

  const injestAudioChuckToPlay = async (base64AudioChunk) => {
    try {
      if (!initialized) {
        await initializeAudioContext();
      }

      if (audioInputContext.state === "suspended") {
        await audioInputContext.resume();
      }
      const arrayBuffer = base64ToArrayBuffer(base64AudioChunk);
      const float32Data = convertPCM16LEToFloat32(arrayBuffer);

      workletNode.port.postMessage(float32Data);
    } catch (error) {
      console.error("Error processing audio chunk:", error);
    }
  };

  const initializeAudioContext = async () => {
    if (initialized) return;

    audioInputContext = new (window.AudioContext || window.webkitAudioContext)({
      sampleRate: 24000,
    });
    await audioInputContext.audioWorklet.addModule("pcm-processor.js");
    workletNode = new AudioWorkletNode(audioInputContext, "pcm-processor");
    workletNode.connect(audioInputContext.destination);
    initialized = true;
  };

  const sendQuery = () => {
    const payload = {
      realtime_input: {
        media_chunks: [
          {
            mime_type: "audio/pcm",
            data: b64PCM,
          },
          {
            mime_type: "image/jpeg",
            data: currentFrameB64,
          },
        ],
      },
    };

    webSocketRef.current.send(JSON.stringify(payload));
    console.log("sent: ", payload);
  };

  // Placeholder to show the component or return null if no UI is needed
  return (
    <div>
      <button onClick={sendQuery}>send question</button>
    </div>
  );
}

// Helper function to add text to a div
const addParagraphToDiv = (divId, message) => {
  const chatLogDiv = document.getElementById(divId);
  if (chatLogDiv) {
    const p = document.createElement("p");
    p.textContent = message;
    chatLogDiv.appendChild(p);
  }
};

export default WebSocketConnection;
